import React from 'react'
import styles from './styles.module.css'

interface IProps {
  classNameBtn: string
  classNameTitle: string
  classNameRemainning: string
  classPercent: string
}

const Progress = ({
  classNameBtn,
  classNameTitle,
  classNameRemainning,
  classPercent
}: IProps) => {
  return (
    <div className={styles.progressContainer}>
      <div style={{ height: 6, margin: '3px 0px', background: '#f1f1f1' }}>
        <div style={{ width: '88%', height: 6 }} className={classNameBtn} />
      </div>
      <div
        style={{
          display: 'flex',
          justifyContent: 'space-between',
          marginTop: 5
        }}
      >
        <div style={{ display: 'flex' }}>
          <div className={classNameTitle}>time</div>
          <span className={classNameRemainning}>remainning</span>
        </div>
        <div className={classPercent}>30%</div>
      </div>
    </div>
  )
}

export default Progress
import React from 'react'
import Progress from './Progress'
import styles from './styles.module.css'

const Chapter = () => {
  return (
    <div style={{ marginTop: 25 }}>
      <div className={styles.titleChapter}>
        Chapter 1: Audit and other assurance engagement
      </div>
      <Progress
        classNameBtn={styles.btnSecondary}
        classNameTitle={styles.timeProgressSecondary}
        classNameRemainning={styles.timeRemainningSecondary}
        classPercent={styles.percentProgress}
      />
    </div>
  )
}

export default Chapter
import * as React from 'react'
import Chapter from './Chapter'
import Progress from './Progress'
import styles from './styles.module.css'

const ExampleComponent = () => {
  return (
    <div className={styles.gridContainer}>
      <div className={styles.columnLeft}>
        <div className={styles.titlePart}>
          Part A: Audit framework and regulation
        </div>
        <div className={styles.descriptionPart}>
          An introduction to supply-and-demand and of analysis for customers and
          firms and pro max.
        </div>
        <Progress
          classNameBtn={styles.btnPrimary}
          classNameTitle={styles.timeProgress}
          classNameRemainning={styles.timeRemainning}
          classPercent={styles.percentProgress}
        />
        <Chapter />
        <Chapter />
        <Chapter />
        <Chapter />
      </div>
      <div className={styles.columnRight}>ddddd</div>
    </div>
  )
}
export default ExampleComponent
